import "./topbar.scss";

export default function Topbar() {
  return (
    <div className="topbar">
      <div className="wrapper">
        <div className="gauche">
          <a href="#presentation" className="logo">
            Anthony Bauchet
          </a>
        </div>
        <div className="itemContainer"></div>
        <div className="itemContainer"></div>
        <div className="droite">C'est a droite</div>
      </div>
    </div>
  );
}
